Defendant Autumn Elaine Durham in court with attorney Robert E Webb.  Hanna Ritchie Kolberg appeared for the State of Wisconsin.  Court finds State has complied with victim notification.  Statements made as to sentencing.  

The Court sentenced the defendant to a MAXIMUM TERM OF IMPRISONMENT of 3 YEARS, with credit for 7 days time served; the INITIAL TERM OF CONFINEMENT in the Wisconsin State Prison System is 1 YEAR and 6 MONTHS; the MAXIMUM TERM OF EXTENDED SUPERVISION is 1 YEAR and 6 MONTHS.  The defendant is not eligible for the Challenge Incarceration Program and is not eligible for the "Wisconsin Substance Abuse Program".

Court STAYED this sentence and placed the defendant on probation for a period of 3 YEARS. 
Court orders the following conditions of probation and extended supervision:  
*Serve 180 DAYS in the House of Correction with Huber release for work, childcare and mental health treatment (REPORT DATE 4/22/16);
*Court imposes and stays 90 days additional condition time in the House of Corrections (to be used at the discretion of the agent);   
*Continue with mental health treatment and follow recommendations;
*No contact with victim MILTON J.;
*Pay restitution (if ordered by the Court);
*Complete anger management programming;
*No new offenses.

Court does not order restitution amount at this time. Court orders: victim to submit proof of expenses as to windshield and seat repair within 45 days.  Court is inclined to make restitution order as to that amount.  Court makes no determination as to fault in traffic accident.
Defendant shall provide a DNA sample for the Data Bank and pay all appropriate costs.
Court ordered defendant to pay all applicable court costs and surcharges.
As to all costs and surcharges, Court orders amounts to be deducted from bail on deposit.  Remaining balance to be returned to the person who posted. 
If revoked, DOC shall collect up to 25% of prison funds.  Remaining balance to be paid during the period of extended supervision.  Any unpaid portion to convert to a civil judgment.   
Court advised defendant that as a convicted felon she may never possess a firearm or body armor.  Court advised defendant that her voting rights are suspended and she may not vote in any election until she civil rights are restored. 

